import React, {Component} from 'react';
import AuthService from '../services/AuthService'
class Admin extends Component {
    logout = () => {
        AuthService.logout();
    };
    render() {

        return (
            <div className='adminBlock'>
                admin
                <button onClick={this.logout}>Bye bye</button>
            </div>
        );
    }

}

export default Admin;
